INSERT INTO `wp_posts` VALUES (7,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Inicio[:en]Home[:]','','publish','closed','closed','','inicio','','','2019-09-20 21:51:29','2019-09-20 21:51:29','',0,'http://www.perubroker.com.pe/?p=7',1,'nav_menu_item','',0),(9,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Nosotros[:en]About[:]','','publish','closed','closed','','nosotros','','','2019-09-20 21:51:29','2019-09-20 21:51:29','',0,'http://www.perubroker.com.pe/?p=9',2,'nav_menu_item','',0),(10,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Servicios[:en]Services[:]','','publish','closed','closed','','servicios','','','2019-09-20 21:51:29','2019-09-20 21:51:29','',0,'http://www.perubroker.com.pe/?p=10',3,'nav_menu_item','',0),(11,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Clientes[:en]Customers[:]','','publish','closed','closed','','clientes','','','2019-09-20 21:51:29','2019-09-20 21:51:29','',0,'http://www.perubroker.com.pe/?p=11',4,'nav_menu_item','',0),(12,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Reportes[:en]Reports[:]','','publish','closed','closed','','reportes','','','2019-09-20 21:51:29','2019-09-20 21:51:29','',0,'http://www.perubroker.com.pe/?p=12',5,'nav_menu_item','',0),(13,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Contctenos[:en]Contact[:]','','publish','closed','closed','','contacto','','','2019-09-20 21:51:29','2019-09-20 21:51:29','',0,'http://www.perubroker.com.pe/?p=13',6,'nav_menu_item','',0),(17,1,'2019-08-05 23:24:03','2019-08-05 23:24:03','<p class=\"Estilo2\" align=\"justify\">Vinculados al comercio internacional desde 1949, y muy especialmente a la industria pesquera, Per Broker S.A. es hoy una de las empresas lderes en nuestro pas en el sector de las representaciones y corretaje.</p>\r\n<p class=\"Estilo2\" align=\"justify\">Entre nuestros clientes, tanto a nivel nacional como internacional, se encuentran tanto grandes multinacionales as como empresas relativamente pequeas y familiares. Tanto en un caso como en el otro, nos centramos en trabajar exclusivamente con aquellas compaas que demuestran responsabilidad y compromiso en sus obligaciones contractuales. En base a los comentarios que hemos recibido de nuestros proveedores y clientes a lo largo de nuestra dilatada trayectoria, hemos llegado a la absoluta seguridad de que brindamos un servicio de primera categora.</p>\r\n<p class=\"Estilo2\" align=\"justify\">Conocedores por dcadas de las actividades econmicas de nuestro pas, nuestros contactos van ms all del sector pesquero (estamos centrados principalmente en harina y aceite de pescado y congelado) e incluyen segmentos de enorme consideracin en la vida del Per, como son la minera, fletamentos, energa, azcar, caf, sal marina y de mina, granos, legumbres, aceites, grasas y otros.</p>','Resumen','','publish','closed','closed','','resumen','','','2019-08-06 02:54:58','2019-08-06 02:54:58','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=17',0,'broker_seccion','',0),(18,1,'2019-08-06 01:57:24','2019-08-06 01:57:24','[:es]PERU BROKER se fundo y constituyo en lima, Per, en febrero del ao 1981, habiendo estado los accionistas y directivos relacionados con el comercio internacional de materias primas desde 1954.\r\n\r\nHoy actuamos como agentes representantes de compaas extranjeras y como comisionistas, para una diversa gama de productos. Adems, hemos desarrollado a lo largo de los aos, un departamento gil y eficaz de shipping o agente de fletamentos, que facilita y economiza los embarques de nuestros proveedores.\r\n\r\nContamos con socios estratgicos en Europa, que cuentan con la misma experiencia adems de un amplsimo nmero de clientes y proveedores; antiguos y nuevos, pero todos ellos de solvencia.\r\n\r\nEsta asociacin estratgica con otra empresa europea de gran reconocimiento en el sector, Hispatrade SA, nos permite, por la diferencia de husos horarios, cubrir de manera adecuada y casi 24 horas diarias, los requerimientos de nuestros clientes asiticos y los de otros continentes.\r\n\r\nEn PERU BROKER S.A. estamos muy al corriente de los requerimientos nutricionales y de las ventajas que tienen tanto la harina como el aceite de pescado, especialmente los de anchoveta peruana (engraulis ringens) en la elaboracin de alimento para una amplia variedad de especies, y nunca perdiendo de vista la responsabilidad biolgica de este recurso as como del medio ambiente marino bsico en el desarrollo de esta actividad.[:]','[:es]Historia[:]','','publish','closed','closed','','historia','','','2019-09-20 01:55:27','2019-09-20 01:55:27','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=18',0,'broker_seccion','',0),(19,1,'2019-08-06 02:01:01','2019-08-06 02:01:01','[:es]Asistir a clientes y proveedores con una informacin imparcial, basada en hechos. Brindar igualmente las ltimas novedades sobre las circunstancias del mercado y los factores que estn influyendo en el mismo; los ltimos precios tratados y su evolucin en las ltimas semanas.\r\n\r\nServir a los clientes interesados en la compra de productos, con los precios ms econmicos disponibles de proveedores de primer orden, sean grandes o pequeos, pero de probada seriedad y alta calidad.\r\n\r\nAtender a los clientes y proveedores con una ejecucin muy profesionalizada de los contratos, siendo la rapidez, la precisin, la informacin, y la capacidad de resolver problemas que pudieran surgir en los embarques, nuestras principales cualidades y cartas en el servicio.\r\n\r\nEn resumen: servir a clientes y proveedores buscando su satisfaccin.[:]','[:es]Objetivos[:]','','publish','closed','closed','','objetivos','','','2019-09-20 01:56:26','2019-09-20 01:56:26','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=19',0,'broker_seccion','',0),(20,1,'2019-08-06 02:03:18','2019-08-06 02:03:18','[:es]Estar alertas y adaptarnos a las nuevas circunstancias de la evolucin de los mercados de materias primas, siempre teniendo presente que realizamos y cumplimos una funcin de ayuda y servicio tanto a los proveedores como a los clientes, labor que venimos realizando desde los inicios de PERU BROKER SA, ahorrando el tiempo en el proceso de compra y ejecucin, pero tambin evitando el desgaste de una relacin, cuando se presentan problemas.\r\n\r\nCabe mencionar que estamos desde ya totalmente involucrados en las nuevas tendencias de consumo humano, como los aceites de alto contenido de cidos grasos Omega-3 y de las harinas especiales, procesadas mediante hidrlisis por fermentacin, de ms alta disponibilidad proteica.[:]','[:es]Idea a futuro[:]','','publish','closed','closed','','idea-a-futuro','','','2019-09-20 02:04:51','2019-09-20 02:04:51','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=20',0,'broker_seccion','',0),(21,1,'2019-08-06 02:05:44','2019-08-06 02:05:44','','[:es]Divisiones[:]','','publish','closed','closed','','divisiones','','','2019-09-23 12:58:15','2019-09-23 17:58:15','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=21',0,'broker_seccion','',0),(22,1,'2019-08-06 02:52:24','2019-08-06 02:52:24','','historia_logo_perubroker','','inherit','open','closed','','historia_logo_perubroker','','','2019-08-06 02:52:24','2019-08-06 02:52:24','',17,'http://www.perubroker.com.pe/wp-content/uploads/2019/08/historia_logo_perubroker.png',0,'attachment','image/png',0),(24,1,'2019-08-06 03:20:12','2019-08-06 03:20:12','Podemos dividir en dos las reas de nuestra empresa:\n<ul>\n 	<li>CORRETAJE DE PRODUCTOS PROPIAMENTE DICHOS</li>\n</ul>\n&nbsp;\n\nFLETAMENTOS\n\n&nbsp;','Divisiones','','inherit','closed','closed','','21-autosave-v1','','','2019-08-06 03:20:12','2019-08-06 03:20:12','',21,'http://www.perubroker.com.pe/21-autosave-v1/',0,'revision','',0),(25,1,'2019-08-06 04:22:02','2019-08-06 04:22:02','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:12:\"broker_staff\";}}}s:8:\"position\";s:6:\"norm